import React from "react";
import Navbar from "./Navbar/Navbar";
import { BrowserRouter, Route } from "react-router-dom";

export default function App() {
  return (
    <>
      <BrowserRouter>
        <Route path="/" element={<Navbar />} />
      </BrowserRouter>
    </>
  );
}
